import React from 'react';
import DesktopShortcut from '../os/DesktopShortcut';
import Window from '../os/Window';

export interface ThisComputerProps extends WindowAppProps {
    onClose: () => void;
    onInteract: () => void;
    onMinimize: () => void;
}

const ThisComputerApp: React.FC<ThisComputerProps> = (props) => {
    return (
        <Window
            top={20}
            left={20}
            width={600}
            height={400}
            windowBarIcon="computerSmall"
            windowTitle="This Computer"
            closeWindow={props.onClose}
            onInteract={props.onInteract}
            minimizeWindow={props.onMinimize}
        >
            <div className="site-page" style={{ height: '100%' }}>
                <iframe
                    src="https://oldgoogle.neocities.org/1998/"
                    title="google"
                    width="100%"
                    height="100%"
                    style={{ border: 'none' }} // Ensures there's no default border on the iframe
                />
                <div style={{ display: 'flex', justifyContent: 'center', marginTop: '10px' }}>
                    <DesktopShortcut
                        icon="computerBig"
                        invertText
                        shortcutName="Computer Details"
                        onOpen={() => {
                            alert('Opening Computer Details...');
                        }}
                    />
                </div>
            </div>
        </Window>
    );
};

export default ThisComputerApp;
